// src/components/Approach.js
import React from "react";
import "./Approach.css";

function Approach() {
  const approachItems = [
    {
      title: "Strategic Partnership",
      description: "Collaborate with healthcare institutions, training centers, and recruitment agencies worldwide."
    },
    {
      title: "Step-by-Step Support",
      description: "Guide candidates through every phase of U.S. licensure and employment."
    },
    {
      title: "Trusted Support",
      description: "Provide a clear path through complex immigration and licensure processes."
    },
    {
      title: "Targeted Marketing & Outreach",
      description: "Use digital marketing, webinars, and online job portals to connect with potential candidates globally."
    },
    {
      title: "Expert Guidance",
      description: "Our dedicated team assists you at every stage, from document review to placement."
    },
    {
      title: "Smooth Transition",
      description: "Resources for cultural integration and training to help you thrive in the U.S. healthcare environment."
    }
  ];

  return (
    <section id="approach" className="approach">
      <h2>Our Approach</h2>
      {approachItems.map((item, idx) => (
        <div className="approach-item" key={idx}>
          <h3>{item.title}</h3>
          <p>{item.description}</p>
        </div>
      ))}
    </section>
  );
}

export default Approach;
